import React from "react";

function WordCard({ word, handleClick, selected }) {
  const handleCardClick = () => {
    handleClick(word);
  };

  return (
    <div className={`card ${selected ? "selected" : ""}`} onClick={handleCardClick}>
      <p>{word.value}</p>
    </div>
  );
}

export default WordCard;
